import React, { useState } from 'react';
import Nav from 'react-bootstrap/Nav';
import './NavLinks.css';
import ButtonBox from '../UIElements/Button';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';
import SearchBar from './Search';
import { ReactComponent as ProfileIcon } from '../../Assets/Images/profile.svg';



const NavLinks = props => {

  // const[logedIn,setlogedIn]=useState(true);

  const logedIn = true;

  const [activeLink, setActiveLink] = useState('');

  const handleLinkClick = (link) => {
    setActiveLink(link);
    console.log(activeLink)
  };
  return (

    <React.Fragment>
       <Nav className="me-auto">

      {logedIn ?

     <React.Fragment>
      <Nav.Link href="/dashboard" 
      onClick={() => handleLinkClick('home')}
      className={activeLink === 'home' ? 'active' : ''}
      >Home</Nav.Link>
      <Nav.Link href="/video-on-demand">Video on Demand</Nav.Link>
      <Nav.Link href="/live">Live Videos</Nav.Link>
      <Nav.Link href="/favorites">Favorites</Nav.Link>
      </React.Fragment>


      : <div></div> }
      </Nav>


<Nav>{logedIn ? <div className='searchProfileWrap'><div><SearchBar/></div><div><Link to="/profile"><ProfileIcon/></Link></div></div> :
  <Link to="/login"><ButtonBox className="primary-button" text="Sign In"/></Link>
}
          </Nav>
</React.Fragment>
)};

export default NavLinks;
